import React from 'react';

const Input= ({
  id,
  label,
  type,
  value,
  onChange,
}) => {
  return (
    <>
      <label htmlFor={id}>{label}</label>
      <input id={id} type={type} size={100} maxLength={100} autoFocus onChange={onChange}/> <br />
    </>
  );
}

export default Input;
